import React, { useState, useEffect } from 'react';
import { Routes, Route, Link } from "react-router-dom";
import KanjiMain from "./KanjiMain";


const Home = () => {
    return (
        <div className="Home">
            <div>
                Home
            </div>
            <Routes>
                <Route path="/kanji" element={<KanjiMain />} />
                </Routes>
        </div>
    )
}

export default Home;
